pragma solidity ^0.5.0;

import '@openzeppelin/contracts/token/ERC721/ERC721Full.sol';
import './TheToken.sol';

contract TheNFTV1 is ERC721Full {
  using SafeMath for uint256;

  uint256 public mintCost = 10e14;     // 0.001 BTC ~10 usd
  uint256 public mintTokenCost = 2e14; // 0.0002 BTC ~2 usd
  address payable public tokenAddress;

  constructor(address payable addr) ERC721Full("Test NFT", "NFT") public {
    tokenAddress = addr;
  }

  function mint() public payable {
    address receiver = msg.sender;
    uint256 payment = msg.value;
    require(payment == mintCost,"insufficient payment");

    TheToken(tokenAddress).mint.value(mintTokenCost)(receiver);

    // address payable receiver = address(uint160(tokenAddress));
  }
}

